JavaScript:
```javascript
function sortTable(column) {
  const table = document.getElementById("myTable");
  let rows, switching, i, x, y, shouldSwitch;
  switching = true;

  while (switching) {
    switching = false;
    rows = table.rows;

    for (i = 1; i < (rows.length - 1); i++) {
      shouldSwitch = false;
      x = rows[i].getElementsByTagName("TD")[column];
      y = rows[i + 1].getElementsByTagName("TD")[column];

      if (x.innerHTML.toLowerCase() > y.innerHTML.toLowerCase()) {
        shouldSwitch = true;
        break;
      }
    }

    if (shouldSwitch) {
      rows[i].parentNode.insertBefore(rows[i + 1], rows[i]);
      switching = true;
    }
  }
}
```

This code will sort the table rows alphanumerically when you click on the table headers. The `sortTable` function takes the column index as an argument and sorts the table based on that column. The sorting is case-insensitive.

 Sure, I'd be happy to help! Compiler optimizations are techniques used by compilers to improve the performance of the generated code. Here are a few popular compiler optimization techniques:

1. Constant Propagation: This technique replaces a variable with a constant value if the variable's value is known at compile time.

Example:
```c
int x = 5;
int y = x + 3;
```
After constant propagation:
```c
int y = 8;
```

2. Dead Code Elimination: This technique removes code that does not affect the program's output.

Example:
```c
int x = 5;
int y = x + 3;
x = 10;
```
After dead code elimination:
```c
int y = 8;
```

3. Loop Unrolling: This technique increases the number of iterations in a loop and reduces the number of loop control instructions.

Example:
```c
for (int i = 0; i < 10; i++) {
    x = x + 1;
}
```
After loop unrolling:
```c
for (int i = 0; i < 10; i += 4) {
    x = x + 1;
    x = x + 1;
    x = x + 1;
    x = x + 1;
}
```

4. Function Inlining: This technique replaces a function call with the body of the function to reduce the overhead of the function call.

Example:
```c
int add(int a, int b) {
    return a + b;
}

int x = add(5, 3);
```
After function inlining:
```c
int x = 5 + 3;
```

5. Common Subexpression Elimination: This technique removes redundant computations by identifying expressions that have the same value and only computing them once.

Example:
```c
int x = a * b;
int y = a * b + c;
```
After common subexpression elimination:
```c
int temp = a * b;
int x = temp;
int y = temp + c;
```

