To convert an object to a Data Transfer Object (DTO) without using Spring, you can manually create a DTO class and map the properties from the original object to the DTO. Here's a simple example:

1. Create a DTO class:

```java
public class UserDTO {
    private String name;
    private String email;

    public UserDTO(String name, String email) {
        this.name = name;
        this.email = email;
    }

    // getters and setters
}
```

2. Create a method to convert the original object to a DTO:

```java
public UserDTO convertUserToDTO(User user) {
    return new UserDTO(user.getName(), user.getEmail());
}
```

3. Use the method to convert the object:

```java
User user = new User("John Doe", "john.doe@example.com");
UserDTO userDTO = convertUserToDTO(user);
```

This is a simple example, and in a real-world application, you might have more complex objects with nested properties. In such cases, you can use libraries like ModelMapper or MapStruct to automate the mapping process.

Here's an example using ModelMapper:

1. Add the ModelMapper dependency to your project.

2. Create a ModelMapper instance:

```java
